    [Parameter]
    public ClienteDTO clienteDTO { get; set; }

    [Parameter]
    public string tituloBoton { get; set; }

    [Parameter]
    public EventCallback<ClienteDTO> ActualizarEditarCliente { get; set; }

    [Parameter]
